import React from 'react';
import './Home.css';
import image1 from '../assets/image1.jpeg'; // Use your preferred image

function Home() {
    return (
        <div className="home-page">
            <div className="image-container">
                <img src={image1} alt="Background" className="background-image rotate" />
                <div className="overlay-text">
                    <h1>Welcome to the GEC Alumni Association Platform</h1>
                    <p>Connecting Alumni, Supporting Growth, and Fostering Success.</p>
                    <button className="get-started-button">Get Started</button>
                </div>
            </div>
        </div>
    );
}

export default Home;
